import React, { Component } from "react";

export default class NextArticle extends Component {
  render() {
    return (
      <div className="next-article-container">
        {/* <div className="next-article-image-container"> */}
        {/* <div className="next-article-image-gradient" /> */}
        <div className="next-article-image" />
        {/* </div> */}
        <p className="next-article-prompt">Next Article</p>
        <h1 className="next-article-name">Youtube 2.0</h1>
      </div>
    );
  }
}
